ot of acting and dancing. A lot of stage acting and body movement acting. Remember learning the banana peel and throwing it in the bin acting with just your body and no talking haha I also remember the teacher teaching me about a technique called cheating out for stage theatre. This is where the whole acting and modeling and dancing begin for me lol. Not to mention I wanted to be a singer and play piano. Lmao I begged my dad to get into this stuff he was not approving of it. So I wasn‚Äôt aloud too. He put me into gymnastics instead lol. This was my Wakakiri story dance award. I participated twice and performed at the Sydney entertainment centre. I remember having my hair and makeup done backstage with my friends and putting on my costume being so nervous. Teacher told me to remember to smile, you have judges that can pick you and you can get a scholarship for dancing. One boy in our group ended up with the dance scholarship. He was so good at doing the backflip, we had hip hop in our third dance routine. I did the 60s dance, our school made it to the next round. Then I remember the next year dance story we did, it was a jungle theme. South Africa style. I still remember the dance moves until this day, still have the dance videos too üòÇ.
